    For example, suppose you go from (0, 0) to (1, 0), which is right on a tree (#) and going from (1, 0) to (2, 0), which is two rightwards and one downwards, you would calculate the smallest angle to a tree then turn right, down, and calculate again the smallest angle to a tree. In this example, the smallest angle would be 19.
    If all angles were larger than 180 degrees, how many angles would be smaller than that?
    '''
