    def adjacent(x, y, seen, n, m):
        if (x, y) in seen:
            return False
        if x == 0 or y == 0:
            return False
        if x == n - 1 or y == m - 1:
            return False
        if board[y][x] == '#':
            return False
        if board[y][x - 1] == '#' and board[y][x] == '#':
            return False
        if board[y - 1][x] == '#' and board[y][x] == '#':
            return False
        if board[y + 1][x] == '#' and board[y][x] == '#':
            return False
        return True

    def get_angle(x, y, seen):
        if (x, y) in seen:
            return None
        for n in range(2, 4):
            if (x, y) == (0, n - 1):
                return 90
            if (x, y) == (n - 1, 0):
                return -90
        for n in range(1, 3):
            if adjacent(x, y, seen, n, n):
                return -1 * n * 90
        for n in range(2, 4):
            if adjacent(x, y, seen, n, n):
                return -1 * n * 90
        return None

    def solve(x, y, seen, angle):
        if (x, y) in seen:
            return True
        seen[(x, y)] = True
        for i in range(4):
            a = get_angle(x, y, seen)
            if a is None:
                continue
            if a == angle:
                if solve(x + 1, y, seen, angle):
                    return True
                if solve(x - 1, y, seen, angle):
                    return True
                if solve(x, y + 1, seen, angle):
                    return True
                if solve(x, y - 1, seen, angle):
                    return True
        seen.pop((x, y))
        return False

    angles = []
    for y in range(n):
        for x in range(m):
            if board[y][x] == '#':
                angle = get_angle(x, y, {})
                if angle is None:
                    continue
                angles.append((x, y, angle))
    print(min(abs(a[2]) for a in sorted(angles)))
    return (min(abs(a[2]) for a in sorted(angles)), (min(a[0] for a in angles), min(a[1] for a in angles)))

